  constructor(){
    super()
    this.state ={
      robots: robots,
      searchField: ''
    }
  }
  render(){
  return (
    <div className='tc'>
      <h1>RoboFriends</h1>
      <SearchBox/>
      <Cardlist robots={robots}/>
    </div>
  );
  }
}

export default App;
